const ItemListContainer = () => {
    return (
    <p>
I need my paddles! Friends don't lie. This is not yours to fix alone. You act like you’re all alone out there in the world, but you’re not. You’re not alone. YOU BETTER RUN! She's our friend, and she's crazy! He’s a sensitive kid. Lonnie used to say he was queer. Called him a fag. Is he? He’s missing, is what he is!

Just wait till we tell Will that Jennifer Hayes was crying at his funeral. Do you know anything about sensory deprivation tanks? Specifically how to build one? Mouth-breather. We never would've upset you if we knew you had superpowers. He’s a sensitive kid. Lonnie used to say he was queer. Called him a fag. Is he? He’s missing, is what he is!    </p>
    )
}

export default ItemListContainer
